import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  return (
    <nav className="Navbar">
      <button>Home</button>

      <button>Logout</button>

      <button>Sign Up</button>
    </nav>
  );
}

export default Navbar;
